import React from "react";
import axios from "axios";
import { Button } from "@mui/material";

const ApiData = () => {
  const getData = () => {
    const collection: string =
      "https://www.rijksmuseum.nl/api/en/collection?key=2esrTh6M&involvedMaker=Rembrandt+van+Rijn";
    const collectionDetials: string =
      "https://www.rijksmuseum.nl/api/en/collection/SK-C-5?key=2esrTh6M";
    const collectionImage: string =
      "https://www.rijksmuseum.nl/api/en/collection/SK-C-5/tiles?key=2esrTh6M";

    const collectionRequest = axios.get(collection);
    const collectionDetailsRequest = axios.get(collectionDetials);
    const collectionImageRequest = axios.get(collectionImage);
    axios
      .all([
        collectionRequest,
        collectionDetailsRequest,
        collectionImageRequest,
      ])
      .then(
        axios.spread((...responses) => {
          if(responses[0].status === 200) {
            console.log(responses[0]);
          }
          if(responses[1].status === 200) {
            console.log(responses[1]);
          }
      })
      )
      .catch((err) => {
        window.alert(err);
      });
  };

  return (
    <>
      <div>ApiData</div>
      <Button onClick={getData}>Get Data</Button>
    </>
  );
};

export default ApiData;
